import React, { Component } from 'react';
import { connect } from 'react-redux';

import FilmsList from '../components/FilmsList';

class FilmsListContainer extends Component {

    render() {
        return <FilmsList />
    }
}

const mapStateToProps = (state) => {
    console.log(state);
    
    return {
        films: state.films
    }
}

export default connect(
    mapStateToProps
)(FilmsListContainer);
